import FilmLog from "./components/Log/FilmLog";
import NewEntry from "./components/NewEntry/NewEntry";
import EntriesFilter from "./components/NewEntry/EntriesFilter";

const App = () => {
  const logList = [
    {
      id: 'f1',
      title: 'Jaws',
      rating: '5',
      date: new Date(2023, 1, 1)
    },
    {
      id: 'f2',
      title: 'The Texas Chainsaw Massacre',
      rating: '5',
      date: new Date(2023, 1, 2)
    },
    {
      id: 'f3',
      title: '2 Fast 2 Furious',
      rating: '2',
      date: new Date(2023, 1, 3)
    },
    {
      id: 'f4',
      title: 'Jay and Silent Bob Strike Back',
      rating: '3',
      date: new Date(2023, 1, 4)
    },
  ]

  const addEntryHandler = entry => {
    console.log('In App.js');
    console.log(entry)
  }

  return (
    <div>
      <NewEntry onAddEntry={addEntryHandler} />
      <EntriesFilter />
      <FilmLog entries={logList} />
    </div>
  );
}

export default App;
